.cucumber-react .cucumber-status--passed {

}

}

}

  font-weight: bold;
}
.cucumber-react .cucumber-title__text {
  font-weight: normal;

  display: flex;

}

  opacity: 0;
  transition: all 0.35s ease-in-out;

  left: -20px;
  display: flex;
  align-items: center;
}
.cucumber-react .cucumber-anchor__icon {
  margin-right: 0.5em;
}
.cucumber-react .cucumber-anchor:hover a {

  transition: all 0.35s ease-in-out;
}

  margin-top: 0px;
}

.cucumber-report-header {
  width: 100%;
  display: grid;
  grid-template-columns: 1fr;
  border: 1px solid rgba(0, 0, 0, 0.1);
  font: 11px "Open Sans", sans-serif;
  margin-bottom: 1em;
}
.cucumber-report-header > * {
  padding: 1em;
}
.cucumber-report-header .cucumber-status-filter {
  border-bottom: 1px solid rgba(0, 0, 0, 0.1);
}
.cucumber-report-header .cucumber-status-filter table {
  width: 100%;
}
.cucumber-report-header .cucumber-execution-data {
  border-bottom: 1px solid rgba(0, 0, 0, 0.1);
}
.cucumber-report-header .cucumber-search-bar {
  border-right: 0;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search {
  width: 100%;
  display: grid;
  grid-template-columns: 9fr 1fr;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search input {
  padding: 0.4em;
  border-radius: 0;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search button {
  height: 2.2em;
  padding-left: 0.6em;
  padding-right: 0.6em;
}
.cucumber-report-header .cucumber-search-bar p.help {
  font-size: 80%;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul {
  display: inline;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul li {
  list-style-type: none;
  display: inline-block;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul li input {
  display: inline-block;
  width: auto;
  height: 0.6em;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul li label {
  padding-right: 1em;
}

@media only screen and (min-width: 600px) {
  .cucumber-report-header {
    grid-template-columns: 1fr 1fr;
  }
  .cucumber-report-header .cucumber-status-filter {
    border-right: 1px solid rgba(0, 0, 0, 0.1);
  }
  .cucumber-report-header .cucumber-search-bar {
    grid-column: 1/-1;
  }
}
@media only screen and (min-width: 992px) {
  .cucumber-report-header {
    grid-template-columns: 1fr 1fr 2fr;
  }
  .cucumber-report-header .cucumber-status-filter {
    border-bottom: 0;
  }
  .cucumber-report-header .cucumber-execution-data {
    border-right: 1px solid rgba(0, 0, 0, 0.1);
    border-bottom: 0;
  }
  .cucumber-report-header .cucumber-search-bar {
    grid-column: auto;
  }
}
.accordion {
    border: 1px solid rgba(0, 0, 0, 0.1);
    border-radius: 2px;
}

.accordion__item + .accordion__item {
    border-top: 1px solid rgba(0, 0, 0, 0.1);
}

.accordion__button {
    background-color: #f4f4f4;
    color: #444;
    cursor: pointer;
    padding: 10px;
    width: 100%;
    text-align: left;
    border: none;
}

.accordion__button:hover {
    background-color: #ddd;
}

.accordion__button:before {
    display: inline-block;
    content: '';
    height: 10px;
    width: 10px;
    margin-right: 12px;
    border-bottom: 2px solid currentColor;
    border-right: 2px solid currentColor;
    transform: rotate(-45deg);
}

.accordion__button[aria-expanded='true']::before,
.accordion__button[aria-selected='true']::before {
    transform: rotate(45deg);
}

.accordion__panel {
    padding: 20px;
    animation: fadein 0.35s ease-in;
}

 directed to the password reset page\n    And I should see three text fields\n\n  @FPResetTestCase1 @FPResetValid\n  Scenario: TestCase1\n    When I enter a valid email to the email reset field\n    And I enter a valid password to the password reset field\n    And I enter a valid retype password to the retype password reset field\n    \n    When I click Reset Password button\n    Then I should not see any reset password error messages\n    And I should be directed to the Login Page\n    \n\n  @FPResetTestCase2 @FPResetInValid\n  Scenario: TestCase2\n    When I enter an invalid email to the email reset field\n    And I enter a valid password to the password reset field\n    And I enter a valid retype password to the retype password reset field\n    \n    When I click Reset Password button\n    Then I should see a popup alert Error Somathing Went Wrong\n    Then I should not be directed to the Login Page\n\n  @FPResetTestCase3 @FPResetInValid\n  Scenario: TestCase3\n    When I enter an invalid email to the email reset field\n    And I enter an invalid password to the password reset field\n    And I enter a valid retype password to the retype password reset field\n    \n   \tAnd I should see an invalid password message\n    \n\t\tWhen I click Reset Password button\n    Then I should not be directed to the Login Page\n\n  @FPResetTestCase4 @FPResetInValid\n  Scenario: TestCase4\n    When I enter an invalid email to the email reset field\n    And I enter an invalid password to the password reset field\n    And I enter an invalid retype password to the retype password reset field\n    \n   \tAnd I should see an invalid password message\n   \tAnd I should see an invalid retype password message\n    \n\t\tWhen I click Reset Password button\n    Then I should not be directed to the Login Page\n\n  @FPResetTestCase5 @FPResetInValid\n  Scenario: TestCase5\n    When I enter a valid email to the email reset field\n    And I enter a valid password to the password reset field\n    And I enter an invalid retype password to the retype password reset field\n    \n   \tThen I should see an invalid retype password message\n    \n\t\tWhen I click Reset Password button\n    Then I should not be directed to the Login Page\n    \n  @FPResetTestCase6 @FPResetInValid\n  Scenario: TestCase6\n    When I enter a valid email to the email reset field\n    And I enter an invalid password to the password reset field\n    And I enter a valid retype password to the retype password reset field\n    \n    Then I should see an invalid password message\n    \n\t\tWhen I click Reset Password button\n    Then I should not be directed to the Login Page\n\n  @FPResetTestCase7 @FPResetInValid\n  Scenario: TestCase7\n    When I enter a valid email to the email reset field\n    And I enter an invalid password to the password reset field\n    And I enter an invalid retype password to the retype password reset field\n    \n    Then I should see an invalid password message\n    And I should see an invalid retype password message\n    \n    When I click Reset Password button\n    Then I should not be directed to the Login Page\n\n  @FPResetTestCase8 @FPResetInValid\n  Scenario: TestCase8\n    When I enter an invalid email to the email reset field\n    And I enter a valid password to the password reset field\n    And I enter an invalid retype password to the retype password reset field\n    \n    And I should see an invalid retype password message\n    \n    When I click Reset Password button\n    Then I should not be directed to the Login Page\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/Samue/PrimeTechJavaClass/SDET_Gang_Framework/./src/test/resources/features/forgotLoginResetLink.feature","feature":{"location":{"line":20,"column":1},"tags":[{"location":{"line":19,"column":1},"name":"@FPResetPasswordFunctionality","id":"58ab62c6-d41b-4c5b-b6bb-5ed50735dc05"}],"language":"en","keyword":"Feature","name":"Test Functionality of Res
